import { useLocation } from "react-router-dom";

function BookingPage() {
  const location = useLocation();
  const bookingData = location.state?.bookingData;

  // Render the booking information in your component
  // ...

  return (
    <div>
      <h2>Booking Details</h2>
      {/* Render the booking information using bookingData */}
      <Card>
        <Card.Body>
          <Card.Title>Booking ID: {bookingData.id}</Card.Title>
          <Card.Text>
            Issue Date: {bookingData.issueDate}<br />
            Return Date: {bookingData.returnDate}<br />
            Amount: {bookingData.amount}<br />
            {/* Add other details as needed */}
          </Card.Text>
        </Card.Body>
      </Card>
      {/* Add other components as needed */}
    </div>
  );
}

export default BookingPage;
